import React from 'react'

const CartBlock = props => {

  const renderItems = () => (
    props.products.cartData &&
      props.products.cartData.map(p => (
        <div key={p._id} className="user_product_block">

        </div>
      ))
  )

  return (
    <div>
      renderItems()
    </div>
  )
}

export default CartBlock
